import React from 'react'
import {Link} from 'react-router-dom'

import { ReactComponent as HomeIcon} from '../icons/home.svg';
import { ReactComponent as ProjectsIcon} from '../icons/projects.svg';
import { ReactComponent as SkillsIcon} from '../icons/skills.svg';
import { ReactComponent as KnowledgeIcon} from '../icons/knowledge.svg';
import { ReactComponent as InterestsIcon} from '../icons/interests.svg';

function Footer(){
    return(
        <footer className="footer">
            <div className="top-5">
            
            <Link to="/timeline" className="menu-item" >
                <span className="icon-button">{<HomeIcon/>}</span>
                <p className="footer-text"> Home </p>
            </Link>
            <Link to="/projects" className="menu-item" >
            </Link>
            <Link to="/competences" className="menu-item" >
            </Link>
            <Link to="/interests" className="menu-item" >
            </Link>
            </div>
            <div className="bottom-5">

            </div>
        </footer>
    )
}
export default Footer;
